import React from 'react';
import "../SignIn.css"
import FacebookLogin from 'react-facebook-login';
import FacebookRoundedIcon from '@mui/icons-material/FacebookRounded';

React.useEffect(() => {
google.accounts.id.initialize({
    client_id : '288915287398-0i4nt92lonqb45kgtmcutach7ckbaffr.apps.googleusercontent.com',
    callback : responseGoole
})
google.accounts.id.renderButton(
    document.getElementById(signInDiv),
    {theme : 'outline', size : 'medium'}
)
},[])

const responseFacebook = (response) => {
    console.log('Encoded JWT ID token : ' ,response.credential);
    // add my own logic here to handle the Facebook login response
};

const responseGoole = (response) => {
    console.log(response);
};

const FacebookAuth = () => {
    return (
        <FacebookLogin
            appId='3373040909602735'
            autoLoad={false}
            fields="name,email,picture"
            textButton=''
            cssClass="oAuth-button"
            callback={responseFacebook}
            icon={<FacebookRoundedIcon className="facebook-icon" sx={{ color: '#3b5998', fontSize: 80, verticalAlign: 'middle', margin: '0px' }} />}
        />
    );
};

const GoogleAuth = () => {
    return (
    <div id = 'signInDiv'></div>
    );
};

const AppleAuth = (props) => {
    return (
        <div className="button-group">
            {props.children}
        </div>
    );
};

export { FacebookAuth, GoogleAuth, AppleAuth };
